import { auth } from "fbase";
import { signOut } from "firebase/auth";

export default function Profile() {
  const handleLogOutClick = () => {
    signOut(auth);
  };
  return (
    <>
      <h1>This is Profile Page!</h1>
      <button onClick={handleLogOutClick}>log out</button>
    </>
  );
}
